import React from 'react';
import styled, { ThemeProvider} from 'styled-components';
import HabitCard from './Habit';
import '../Sass/app.scss';

export const theme = {
    niceYellow: '#F1E100',
    font: "sans-serif",
    niceBlue: '#1919E6'
};

