const GlobalStyles = styled.div`
    font-family: ${props => props.theme.font};
    color: ${props => props.theme.niceBlue};
`

class App extends React.Component {

    render() {
        return (
            <ThemeProvider theme={theme}>
                <GlobalStyles>
                    <HabitCard/>
                    {/* <ListTemplate /> */}
                </GlobalStyles>
            </ThemeProvider>
        )
    }
}

export default App;
